import DivHomeStyled from "../../Styles/DivHome";
import Button from "../Button";
import bin from "../../Assets/bin.svg";

const MainHome = ({ setModal, dadosUsuario }) => {
  console.log(dadosUsuario);
  return (
    <DivHomeStyled>
      <div className="headerTech">
        <p className="tech">Tenologias</p>
        <Button className="addButton" onClick={() => setModal(true)}>
          +
        </Button>
      </div>
      <div className="containerList">
        {dadosUsuario.map((obj) => {
          <div className="post">
            <p className="techName">{obj.name}</p>
            <div className="containerButton">
              <div className="level">{obj.course_module}</div>
              <Button className="deletePost">
                <img src={bin} alt="bin" />
              </Button>
            </div>
          </div>;
        })}
      </div>
    </DivHomeStyled>
  );
};
export default MainHome;
